import Head from 'next/head';
import styles from "./index.module.css";

export default function Home() {
  return (
    <div className={styles.container}>
      <Head>
        <title>DUMMY FRONTEND PROJEKAT</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>
        Landing page za dummy projekat.
        <div className={styles.linkContainer}>
            <div className={styles.item}>Idite na /amila da vidite bezveze komponentu</div>
            <div className={styles.item}>Idite na /books da vidite malo manje bezveze komponentu</div>
            <div className={styles.item}>Idite na /colorChange da vidite kako komponenta moze mijenjati svoj state</div>
        </div>
    </div>
  )
}
